/**
 * @param {number[]} nums
 * @param {number} k
 * @param {number} dist
 * @return {number}
 */
var minimumCost = function(nums, k, dist) {
    let dp = new Array(k+1).fill(0).map(() => new Array(nums.length).fill(Infinity));
    for (let i = 0; i < nums.length; i++) dp[1][i] = nums[i];

    for (let i = 2; i <= k; i++) {
        for (let j = i-1; j < nums.length; j++) {
            for (let l = 1; l <= dist + 1 && j-l >= 0; l++) {
                dp[i][j] = Math.min(dp[i][j], dp[i-1][j-l] + nums[j-l]);
            }
        }
    }

    let ans = Infinity;
    for (let i = nums.length-k; i < nums.length; i++) {
        ans = Math.min(ans, dp[k][i]);
    }

    return ans;
};
